import * as React from "react";
import { extendTheme } from "@mui/material/styles";
import DashboardIcon from "@mui/icons-material/Dashboard";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import BarChartIcon from "@mui/icons-material/BarChart";
import DescriptionIcon from "@mui/icons-material/Description";
import LayersIcon from "@mui/icons-material/Layers";
import { AppProvider } from "@toolpad/core/AppProvider";
import { DashboardLayout } from "@toolpad/core/DashboardLayout";
import { PageContainer } from "@toolpad/core/PageContainer";
import Grid from "@mui/material/Grid";
import { getAllTickets } from "./authService";
import { DataGrid } from "@mui/x-data-grid";
import { Dialog, Backdrop, Paper, Typography, IconButton } from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";


const NAVIGATION = [
  {
    kind: "header",
    title: "Main items",
  },
  {
    segment: "dashboard",
    title: "Tickets",
    icon: <DashboardIcon />,
  },
  {
    segment: "orders",
    title: "Create",
    icon: <ShoppingCartIcon />,
  },
  {
    kind: "divider",
  },
  {
    kind: "header",
    title: "Billing",
  },
  {
    segment: "reports",
    title: "Invoices",
    icon: <BarChartIcon />,
    children: [
      {
        segment: "sales",
        title: "Open",
        icon: <DescriptionIcon />,
      },
      {
        segment: "traffic",
        title: "Closed",
        icon: <DescriptionIcon />,
      },
    ],
  },
  {
    segment: "integrations",
    title: "Ping",
    icon: <LayersIcon />,
  },
];

const demoTheme = extendTheme({
  colorSchemes: { light: true, dark: true },
  colorSchemeSelector: "class",
  breakpoints: {
    values: { xs: 0, sm: 600, md: 600, lg: 1200, xl: 1536 },
  },
});

function useDemoRouter(initialPath) {
  const [pathname, setPathname] = React.useState(initialPath);
  return {
    pathname,
    searchParams: new URLSearchParams(),
    navigate: (path) => setPathname(String(path)),
  };
}

export default function DashboardLayoutBasic(props) {
  const { window } = props;
  const router = useDemoRouter("/dashboard");
  const demoWindow = window ? window() : undefined;

  const [tickets, setTickets] = React.useState([]);
  const [loading, setLoading] = React.useState(true);
  const [selectedTicket, setSelectedTicket] = React.useState(null);

  React.useEffect(() => {
    const fetchTickets = async () => {
      try {
        const data = await getAllTickets();
        setTickets(data);
      } catch (error) {
        console.error("Failed to fetch tickets:", error.message);
      } finally {
        setLoading(false);
      }
    };
    if (router.pathname === "/dashboard") fetchTickets();
  }, [router.pathname]);

  const columns = [
    { field: "id", headerName: "ID", width: 100 },
    { field: "ticketStatus", headerName: "Status", width: 130 },
    {
      field: "assignee",
      headerName: "Assignee",
      width: 200,
      valueGetter: (value, row) => {
        return row.assignee
          ? `${row.assignee.firstName || ""} ${row.assignee.lastName || ""}`
          : "Unassigned";
      },
    },
    { field: "createdAt", headerName: "Created At", width: 180 },
  ];

  const handleClose = () => {
    setSelectedTicket(null);
  };

  return (
    <AppProvider navigation={NAVIGATION} router={router} theme={demoTheme} window={demoWindow}>
      <DashboardLayout>
        <PageContainer>
          <Grid container spacing={2}>
            {router.pathname === "/dashboard" && (
              <>
                <Grid item xs={12}>
                  <Paper sx={{ height: 400, width: "100%" }}>
                    <DataGrid
                      rows={tickets}
                      columns={columns}
                      loading={loading}
                      pageSizeOptions={[5, 10]}
                      onRowClick={(params) => setSelectedTicket(params.row)}
                    />
                  </Paper>
                </Grid>
              </>
            )}
          </Grid>
        </PageContainer>
      </DashboardLayout>

      {/* Dialog for Ticket Details */}
      <Dialog
        open={!!selectedTicket}
        onClose={handleClose}
        fullScreen
        BackdropComponent={Backdrop}
        BackdropProps={{ open: !!selectedTicket }}
      >
        <Paper
          sx={{
            width: "80%",
            maxWidth: "900px",
            margin: "auto",
            mt: 4,
            p: 3,
            borderRadius: 2,
          }}
        >
          <IconButton
            onClick={handleClose}
            sx={{ position: "absolute", top: 10, right: 10 }}
          >
            <CloseIcon />
          </IconButton>

          <Typography variant="h5" gutterBottom>
            Ticket Details
          </Typography>
          {selectedTicket && (
            <>
              <Typography><b>ID:</b> {selectedTicket.id}</Typography>
              <Typography><b>Status:</b> {selectedTicket.ticketStatus}</Typography>
              <Typography><b>Assignee:</b> {selectedTicket.assignee ? `${selectedTicket.assignee.firstName} ${selectedTicket.assignee.lastName}` : "Unassigned"}</Typography>
              <Typography><b>Created At:</b> {selectedTicket.createdAt}</Typography>
              {/* Add more details as needed */}
            </>
          )}
        </Paper>
      </Dialog>
    </AppProvider>
  );
}
